import React, { Fragment } from "react";
import "./App.css";
import Navbar from "./component/layout/Navbar";
import { BrowserRouter as Router, Route, Switch } from "react-router-dom";

const App = () => {
  return (
    <Router>
      <Fragment className="App">
        <Navbar />
        My App
      </Fragment>
    </Router>
  );
};

export default App;
